import React, { useState, useEffect }  from 'react';
import axios from "axios";
const Home = () => {
    //const[initialData, setInitialData] =useState([{}])
    useEffect (() => {
        fetch('/getAllPastMovies').then(
            response => response.json()
        ).then(pastMovieData =>console.log(pastMovieData))

        fetch('/getAllPastTrendingMovies').then(
            response => response.json()
        ).then(pastTrendingData =>console.log(pastTrendingData))

        fetch('/topTenTrendingMoviesNow').then(
            response => response.json()
        ).then(currentTrendingData =>console.log(currentTrendingData))

        fetch('/topTenMoviesNow').then(
            response => response.json()
        ).then(currentMovieData =>console.log(currentMovieData))
    })

    }



export default Home;
